import React, { useEffect, useState } from "react";
import Papa from "papaparse";

const Table1 = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/Table_Input.csv")
      .then((response) => response.text())
      .then((csvText) => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            setData(results.data);
          },
        });
      });
  }, []);

  return (
    <div className="table-container">
      <table>
        <thead>
          <tr>
            <th colSpan={2} style={{ textAlign: 'center' }}>A</th>
            <th colSpan={1} style={{ textAlign: 'center' }}>B</th>
          </tr>
          <tr>
            <th>Index #</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, idx) => (
            <tr key={row["Index #"] || idx}>
              <td>{row["Index #"]}</td>
              <td>{row["Value"]}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table1;
